                <img src={myImage} alt="Ícone 1" />
            </div>        <i className="icon icon2" /> {/* Coloque seu ícone aqui */}
        <i className="icon icon3" /> {/* Coloque seu ícone aqui */}
      </div>
    </header>
  );
};

